from google import genai
from google.genai import types
import base64

def generate():
  client = genai.Client(
      vertexai=True,
      project="ocr-training-450612",
      location="global",
  )

  msg1_document1 = types.Part.from_bytes(
      data=base64.b64decode(""""""),
      mime_type="application/pdf",
  )
  msg1_document2 = types.Part.from_bytes(
      data=base64.b64decode(""""""),
      mime_type="application/pdf",
  )
  msg1_document3 = types.Part.from_bytes(
      data=base64.b64decode(""""""),
      mime_type="application/pdf",
  )
  msg1_document4 = types.Part.from_bytes(
      data=base64.b64decode(""""""),
      mime_type="application/pdf",
  )
  msg1_document5 = types.Part.from_bytes(
      data=base64.b64decode(""""""),
      mime_type="application/pdf",
  )
  msg1_document6 = types.Part.from_bytes(
      data=base64.b64decode(""""""),
      mime_type="application/pdf",
  )
  msg1_text1 = types.Part.from_text(text="""You are an expert document parser for Indian transport documents.

Extract the following fields from this document:
- Date
- Vehicle Number
- Name (Weighbridge name)
- Material
- Net Weight in Tons (convert if needed

Respond ONLY in valid JSON format like this:


  \"Date\": \"...\",
  \"Vehicle Number\": \"...\",
  \"Name\": \"...\",
  \"Material\": \"...\",
  \"Net Weight (Tons)\": \"...\"""")

  model = "gemini-2.5-flash-lite-preview-06-17"
  contents = [
    types.Content(
      role="user",
      parts=[
        msg1_document1,
        msg1_document2,
        msg1_document3,
        msg1_document4,
        msg1_document5,
        msg1_document6,
        msg1_text1
      ]
    ),
  ]

  generate_content_config = types.GenerateContentConfig(
    temperature = 1,
    top_p = 0.95,
    max_output_tokens = 65535,
    safety_settings = [types.SafetySetting(
      category="HARM_CATEGORY_HATE_SPEECH",
      threshold="OFF"
    ),types.SafetySetting(
      category="HARM_CATEGORY_DANGEROUS_CONTENT",
      threshold="OFF"
    ),types.SafetySetting(
      category="HARM_CATEGORY_SEXUALLY_EXPLICIT",
      threshold="OFF"
    ),types.SafetySetting(
      category="HARM_CATEGORY_HARASSMENT",
      threshold="OFF"
    )],
    thinking_config=types.ThinkingConfig(
      thinking_budget=0,
    ),
  )

  for chunk in client.models.generate_content_stream(
    model = model,
    contents = contents,
    config = generate_content_config,
    ):
    print(chunk.text, end="")

generate()